import classNames from 'classnames/bind';
import styles from './Login.module.scss';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faArrowLeft, faBackward, faChevronLeft } from '@fortawesome/free-solid-svg-icons';

const cx = classNames.bind(styles);

function Login() {
    return (
        <div class={cx('wrapper')}>
            <div class={cx('fadeIn first')}>
                <img
                    src="https://media.wired.co.uk/photos/626c4ae5c7aeb6a48f3c9c68/3:2/w_2025,h_1350,c_limit/Spirited-Away-Studio-Ghibli-Ranking-MMDSPAW_EC001.jpg"
                    id="icon"
                    alt="User Icon"
                />
            </div>

            <h4>
                <FontAwesomeIcon className={cx('back-icon')} icon={faChevronLeft} />
                Đăng nhập
            </h4>

            <form>
                <input type="text" id="login" class={cx('fadeIn second')} name="login" placeholder="Tên đăng nhập" />
                <input type="password" id="password" class={cx('fadeIn third')} name="login" placeholder="Mật khẩu" />
                <input type="submit" class={cx('fadeIn fourth')} value="Đăng nhập" />
            </form>

            <div id="formFooter">
                <a class={cx('underlineHover')} href="#">
                    Quên mật khẩu?
                </a>
            </div>
        </div>
    );
}

export default Login;
